import React from 'react';
import styles from './style.scss';
import { Page, PageContent, Card, Button, CardContent } from '@hvisions/f-ui';
import classnames from 'classnames';

const ManualSheet = ({ item }) => {
  const columns = [
    {
      title: '托盘号',
      dataIndex: 'code',
      key: 'code',
      align: 'center'
    },
    {
      title: '任务状态',
      dataIndex: 'taskStatus',
      key: 'taskStatus',
      align: 'center'
    },
    {
      title: '托盘状态',
      dataIndex: 'state',
      key: 'state',
      align: 'center'
    }
  ];

  const data = [
    {
      code: '111',
      taskStatus: '222',
      state: '333'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    },
    {
      code: '444',
      taskStatus: '555',
      state: '666'
    }
  ];

  return (
    <Page pageContent={false}>
      <Navbar>
        <NavLeft>
          <a onClick={() => f7router.back()} className="ne-navleft">
            <img alt="" style={{ height: 24 }} src={backIcon} />
          </a>
        </NavLeft>
        <NavTitle>原材料收料单</NavTitle>
        <NavRight className={styles['nav-right']}>
          <Link
            searchbarEnable=".searchbar-demo"
            iconIos="f7:search"
            iconAurora="f7:search"
            iconMd="material:search"
          ></Link>
        </NavRight>
        <Searchbar
          className="searchbar-demo"
          placeholder="请输入收料单号"
          expandable
          searchContainer=".search-list"
          searchIn=".item-title"
          onChange={onChangeSelect}
          onClickClear={onChangeSelect}
          onClickDisable={handleClickDisable}
          disableButtonText="取消"
          style={{ fontSize: 13 }}
        ></Searchbar>
      </Navbar>
      <Toolbar tabbar top noHairline className="ne-top-tab">
        <Link tabLink="#tab-1" onClick={() => setTabKey(0)} tabLinkActive>
          新建
        </Link>
        <Link tabLink="#tab-2" onClick={() => setTabKey(1)}>
          称重中
        </Link>
        <Link tabLink="#tab-3" onClick={() => setTabKey(2)}>
          已完成
        </Link>
      </Toolbar>
      <PageContent
        infinite
        infiniteDistance={50}
        infinitePreloader={showPreloader}
        onInfinite={loadMore}
        ptrPreloader={ptrPreloader}
        ptr
        onPtrRefresh={onHandleRefresh}
        onPtrPullStart={() => {
          setPtrPreloader(true);
        }}
      >
        <div style={{ padding: '0 16px' }} className={styles.tabContainer}>
          <Tabs animated>
            <Tab
              id="tab-1"
              className={`${styles.content} page-content`}
              style={{ paddingTop: '0' }}
              tabActive
            >
              {renderCardList()}
            </Tab>
            <Tab
              id="tab-2"
              className={`${styles.content} page-content`}
              style={{ paddingTop: '0' }}
            >
              {renderCardList()}
            </Tab>
            <Tab
              id="tab-3"
              className={`${styles.content} page-content`}
              style={{ paddingTop: '0' }}
            >
              {renderCardList()}
            </Tab>
          </Tabs>
        </div>
      </PageContent>
      <div className={styles['detail-bottom']}>
        {tabKey == 0 && <Button className={styles['bottom-btn-confirm']}  onClick={() => handleAutomatic()} >
          {getFormattedMsg('RawMaterialWarehousing.button.automatic')}
        </Button>}
        {tabKey == 0 && <Button className={styles['bottom-btn-confirm']}  onClick={() => handleManual()} >
          {getFormattedMsg('RawMaterialWarehousing.button.manual')}
        </Button>}
        {tabKey == 0 && <Button className={styles['bottom-btn-confirm']}  onClick={() => handleBinding()}>
          {getFormattedMsg('RawMaterialWarehousing.button.binding')}
        </Button>}
        {tabKey == 1 && <Button className={styles['bottom-btn-one']}  onClick={() => handleWeighing()} >
          {getFormattedMsg('RawMaterialWarehousing.button.weighing')}
        </Button>}
        {tabKey == 2 && <Button className={styles['bottom-btn-one']}  onClick={() => handleWarehousing()} >
          {getFormattedMsg('RawMaterialWarehousing.button.warehousing')}
        </Button>}
      </div>
      <Sheet
        style={{ height: 'auto' }}
        swipeToClose
        push
        backdrop
        opened={manualSheet}
        onSheetClosed={() => {
          setManualSheet(false);
        }}
      >
        <div className="swipe-handler"></div>
        <ManualSheet />
      </Sheet>
    </Page>
    // <PageContent
    //   infinite
    //   infiniteDistance={50}
    //   // infinitePreloader={showPreloader}
    //   // onInfinite={loadMore}
    //   // ptrPreloader={ptrPreloader}
    //   ptr
    //   // onPtrRefresh={onHandleRefresh}
    //   // onPtrPullStart={() => {
    //   //   setPtrPreloader(true);
    //   // }}
    // >
    //   <div
    //     style={{ padding: '0 16px', backgroundColor: '#f4f5f5' }}
    //     className={styles.tabContainer}
    //   >
    //     <ul className={styles['div-ul']}>
    //       <li>
    //         <span className={styles['li-title']}>{'托盘手动下架'}</span>
    //       </li>
    //       {data.map((value, index) => {
    //         return (
    //           <Card key={index} className={styles['card']}>
    //             <ul className={styles['card-ul']}>
    //               <li>
    //                 <span className={styles['li-next-title']}>托盘号</span>
    //                 <span className={styles['li-next-title']}>{value.code || ''}</span>
    //               </li>
    //               <li>
    //                 <span className={styles['li-next-title']}>任务状态</span>
    //                 <span className={styles['li-next-title']}>{value.taskStatus || ''}</span>
    //               </li>
    //               <li>
    //                 <span className={styles['li-next-title']}>托盘状态</span>
    //                 <span className={styles['li-next-title']}>{value.state || ''}</span>
    //               </li>
    //             </ul>
    //             <div className={styles['card-div']}>
    //               <Button
    //                 fill
    //                 round
    //                 className={styles['bottom-btn-confirm']}
    //                 // onClick={handleConfirm}
    //               >
    //                 下架
    //               </Button>
    //             </div>
    //           </Card>
    //         );
    //       })}
    //     </ul>
    //   </div>
    // </PageContent>
  );
};

export default ManualSheet;
